function Country1() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("https://data.cityofnewyork.us/resource/erm2-nwe9.json?")
      .then((resp) => resp.json())
      .then((apiData) => {
        setData(apiData);
        console.log(apiData);
      });
  }, []);

  return (
    <div>
      <h1> {data}</h1>
    </div>
  );
}
export default Country1;
